    "Tissue residues and hazards of water-borne pesticides for federally listed and
    candidate fishes of the Sacramento-San Joaquin River Delta, California: 1993-1995",nt"tracking_summary":
    {ntt"total": 12,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:25.243585",nt"name": "tissue-residues-and-hazards-of-water-borne-pesticides-for-federally-listed-and-candid-1993",nt"isopen":
    false,nt"url": null,nt"notes": "The Sacramento-San Joaquin Delta is formed
    at the confluence of the south-flowing Sacramento River and the north-flowing San
    Joaquin River. The Delta provides habitat to many species of aquatic wildlife, including
    the federally-listed, threatened Delta smelt (Hypomesus transpacificus) and Sacramento
    winter-run chinook (Oncorhynchus tschawytscha) and the proposed-threatened longfin
    smelt (Spirinchus thaleichthys) and Sacramento splittail (Pogonichthys macrolepidotus).
    Many fisheries are in a rapid decline in the Delta, smelt populations are estimated
    to have declined approximately 90% in the last 20 years, and water contamination
    is one suspected cause. This report summarizes the results of three studies conducted
    by the U.S. Fish and Wildlife Service between 1994 and 1995. Biologists surveyed
    water and fish for metals, trace elements, and organics from the Sacramento and
    San Joaquin Rivers, to evaluate potential metal and trace element loading, and performed
    toxic identification evaluations (TIEs) on water from the back sloughs of the Delta.
    The studies were scoping in nature, designed to screen for potential problems and
    define the direction and focus of future investigations.",nt"license_title":
